class FeatureEncoder:
    def __init__(self, table, model_seed):
        self.table = table
        self.model_seed = model_seed

    def encode_features(self, properties):
        return self.encode_features_from_flattened(flatten_properties(properties))

    def encode_partial_features(self, property_key, variant):
        return self.encode_features_from_flattened(flatten_properties({property_key: variant})) # FIX could eliminate extra dict creation by using a form of flatten() that takes a prefix string/root key

    def encode_features_from_flattened(self, flattened):
        
        features = {}
        noise = -3  # random.gauss(0, -3) #  was (0, 1) use the same noise for all values in a variant (and all context values)

        for feature_name, value in flattened.items():
            column = lookup_column(self.table, feature_name, self.model_seed)
            if isinstance(value, bool): # check bool first, because its an instanceof int
                features[column] = 1.0 if value else 0.0
            elif isinstance(value, (int, float)):
                features[column] = float(value)
            elif value is None: # json null, probably needs to be checked after the numerics to avoid 0s and falses being Noneish?  null is treated as a missing feature
                pass
            elif isinstance(value, str):
                features[column] = lookup_value(self.table, column, value, self.model_seed, noise)
    
        return features
        
    def get_column_count(self):
        return len(self.table[1])
        
def flatten_properties(properties):
    return flatten(properties, '\0')
    
def lookup_column(table, key, model_seed, w=1):
    t0 = table[0]
    c = t0[mmh3.hash(key, model_seed, signed=False) % len(t0)]
    return (abs(c)-1 if c < 0 else mmh3.hash(key, c^model_seed, signed=False)) % (len(table[1])//w)

def lookup_value(table, column, string, model_seed, noise):
    t = table[1][column]
    t1 = t[1]
    c = lookup_column(t, string, model_seed, w=2)*2
    return t1[c]+t1[c+1]*noise


